let preguntaActual = 0;

function cargarPregunta() {
    const preguntaElemento = document.getElementById('pregunta');
    const imagenElemento = document.getElementById('imagen');
    const opcionesElemento = document.getElementById('opciones');
    const resultadoElemento = document.getElementById('resultado');
    const siguienteBoton = document.getElementById('siguiente');

    const pregunta = preguntas[preguntaActual];
    
    preguntaElemento.textContent = pregunta.pregunta;
    imagenElemento.src = pregunta.imagen;
    opcionesElemento.innerHTML = '';

    pregunta.opciones.forEach(opcion => {
        const boton = document.createElement('button');
        boton.textContent = opcion;
        boton.className = 'answer-button';
        boton.onclick = () => verificarRespuesta(opcion);
        opcionesElemento.appendChild(boton);
    });

    resultadoElemento.textContent = '';
    siguienteBoton.style.display = 'none';
}

function verificarRespuesta(respuesta) {
    const pregunta = preguntas[preguntaActual];
    const resultadoElemento = document.getElementById('resultado');
    const siguienteBoton = document.getElementById('siguiente');
    
    if (respuesta === pregunta.respuestaCorrecta) {
        resultadoElemento.textContent = '¡Correcto!';
        resultadoElemento.style.color = 'green';
    } else {
        resultadoElemento.textContent = 'Incorrecto.';
        resultadoElemento.style.color = 'red';
    }

    siguienteBoton.style.display = 'block';
}

function siguientePregunta() {
    preguntaActual++;
    if (preguntaActual < preguntas.length) {
        cargarPregunta();
    } else {
        mostrarResultadoFinal();
    }
}

function mostrarResultadoFinal() {
    const juegoElemento = document.getElementById('juego');
    juegoElemento.innerHTML = '<h1>¡Has completado el juego!</h1>';
}

window.onload = cargarPregunta;
